import React from 'react';

function Header() {
    return (
        <header id="header" className={this.state.currentScrollHeight > 100 ? "header-moving" : "header-top"}>
            <div className="content-container">
                <div className = "header-container">
                    <button onClick={this.scrollToTop} className={this.state.currentScrollHeight > 100 ? "button-logo-moving" : "button-logo-top"}>AP</button>
                    <nav className="header__links">
                        <button 
                        className={this.state.currentScrollHeight > 100 
                        ? "button-subtitle-moving" 
                        : "button-subtitle-top"}>
                            <Link
                            activeClass="active"
                            to="about"
                            offset={-this.state.headerHeight}
                            spy={true}
                            smooth={true}
                            duration= {500}
                            >About</Link>
                        </button>
                        
                        <button 
                        className={this.state.currentScrollHeight > 100 
                        ? "button-subtitle-moving" 
                        : "button-subtitle-top"}>
                            <Link
                            activeClass="active"
                            to="projects"
                            offset={-this.state.headerHeight}
                            spy={true}
                            smooth={true}
                            duration= {500}
                            >Projects</Link>
                        </button>
                        
                        <button 
                        className={this.state.currentScrollHeight > 100 
                        ? "button-subtitle-moving" 
                        : "button-subtitle-top"}>
                            <Link
                                activeClass="active"
                                to="contact"
                                offset={-this.state.headerHeight}
                                spy={true}
                                smooth={true}
                                duration= {500}
                            >Contact</Link>
                        </button>
                    </nav>
                </div>
            </div>
        </header>
    )
}

export default Header;
